import React from "react";
import { useForm } from "../../hooks/useForm";
import { Main, InputMaterial } from './style';



 const SignUp = () => {
    const {form, onChange, clean} = useForm({
        "name": "",
        "email": "",
        "cpf": "",
        "password": ""
    })
    const onSubmitForm = (event) =>{
        event.preventDefault()
    }

    return (

    <Main>
        <p>Cadastrar</p>
        <form onSubmit={onSubmitForm}>
            <InputMaterial
                id="outlined-basic"
                label={"Nome"}
                name='name'
                type={"text"}
                placeholder={"Digite seu nome"}
                variant="outlined"
                value={form.name}
                onChange={onChange}
            />
            <InputMaterial
                id="outlined-basic"
                label={"Email"}
                name='email'
                type={"text"}
                placeholder={"Digite seu email"}
                variant="outlined"
                value={form.email}
                onChange={onChange}
                required
        />

        </form>
    </Main>

    )
}
export default  SignUp
